import Card from 'react-bootstrap/Card'
import { Carousel, Container } from 'react-bootstrap'
import classes from './Other.module.css'
import { Am, Amre, Car360, Carcon, Fm, Og, Yg } from '../../src/assets/index.js'

const Other = () => {
  return (
    <>
      <Card
        className={classes.cardbody} bg="secondary" text="white" >
        <Card.Body>
          <Card.Title><b>Other</b></Card.Title>
          <Card.Text>
            Here you will find some of my other creative work.
          </Card.Text>
        </Card.Body>
      </Card>
      <Container className={classes.carouselcontainer}>
        <Carousel className={classes.carouselbody}>
          <Carousel.Item>
            <img
              className={classes.carouselimage}
              src={Am}
              alt="First slide"
            />
            <Carousel.Caption className={classes.carouselcaption}>
              <h5>Amser</h5>
              <p>Recorded and engineered in The Atrium Studios, United Kingdom by Adrian Strozzi</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img
              className={classes.carouselimage}
              src={Amre}
              alt="Second slide"
              href="https://rafaelbarreramusic.bandcamp.com/album/amser"
            />
            <Carousel.Caption>
              <h5>Amser Review</h5>
              <p>Amser Review by Contratiempo Jazz</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img
              className={classes.carouselimage}
              src={Car360}
              alt="Third slide"
            />
            <Carousel.Caption>
              <h5>Cardiff 360 with Spatial Audio</h5>
              <p>Produced by Adrian Strozzi</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img
              className={classes.carouselimage}
              src={Carcon}
              alt="Fourth slide"
            />
            <Carousel.Caption>
              <h5>Honorary Consul For Mexico in Wales</h5>
              <p>Mention from Honorary Consul Glynn Pegler</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img
              className={classes.carouselimage}
              src={Fm}
              alt="Fifth slide"
            />
            <Carousel.Caption>
              <h5>Forward Motion Single by Rafael Barrera</h5>
              <p>Recorded and Engineered in The Atrium Studios, United Kingdom by Adrian Strozzi</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img
              className={classes.carouselimage}
              src={Og}
              alt="sixth slide"
            />
            <Carousel.Caption>
              <h5>Overgrown Single by Cardiff Band "Joby"</h5>
              <p>Recorded and Engineered in The Atrium Studios, United Kingdom by Adrian Strozzi</p>
            </Carousel.Caption>
          </Carousel.Item>
          <Carousel.Item>
            <img
              className={classes.carouselimage}
              src={Yg}
              alt="Seventh slide"
            />
            <Carousel.Caption>
              <h5>Young Revolt</h5>
              <p>Band single. Music and lyrics by Adrian Strozzi.</p>
            </Carousel.Caption>
          </Carousel.Item>
        </Carousel>
      </Container>
    </>
  )
}

export default Other;



